import React from "react";
import videoData from "./exampleresponse.json";

function LoadVideo() {
  return (
    <div>
      {videoData.map((video) => (
        <h2 key={video.id}>{video.title}</h2>
      ))}
    </div>
  );
}

export default LoadVideo;
